import React, { FunctionComponent, useEffect, useState } from 'react';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';
import Alert from '@material-ui/lab/Alert';
import CSS from 'csstype';
import {get_library} from '../services/http-requests'
import { Container , Row, Col } from 'react-bootstrap';
import { Hidden } from '@material-ui/core';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';
import { Theme, createStyles, makeStyles } from '@material-ui/core/styles';
import {Video} from '../components/video'

const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      display: 'flex',
      flexWrap: 'wrap',
      justifyContent: 'space-around',
      backgroundColor: 'red',
    },
    gridList: {
      height: '690px',
      backgroundColor: 'blue'
    },
  }),
);

type Video = {
  title: string,
  id: string,
  name: string
}

export const LibraryPage: FunctionComponent<{ initial?: string }> = ({ initial = "" })=> {

  const [videos, setVideos] = useState<Array<Video>>([
    {title: "string",id: "strindg",name: "string"},
    {title: "string",id: "strieng",name: "string"},
    {title: "string",id: "stdrieng",name: "string"},
    {title: "string",id: "strideng",name: "string"},
    {title: "string",id: "sstrideng",name: "string"},
    {title: "string",id: "ssdtrideng",name: "string"},
    {title: "string",id: "sdstrideng",name: "string"},
    {title: "string",id: "strizng",name: "string"}
  ]);
  const [vo, setVo] = useState<string>("");
  const classes = useStyles();

  useEffect(() => {
    get_library()
    .then(response => {
      let data = response.data;
      console.log(data['data']);
      setVideos(data['data'])
      console.log(videos);
      setVo("eeeoooooooooo")

    })
    .catch((e) => {
      console.log(e);
    });
  },[]);

  return <>
  <div style={containerStyle}>
    <div style={boxStyle}>
      <Container>
        <Row style={containers}>
          <Col style={videosContainer} xs={6} md={4}>
            <h2>Your library</h2>
            <GridList cellHeight={160} className={classes.gridList} cols={3}>
              {videos.map((v) => (
                <GridListTile key={v.id} cols={ 1}>
                  <Video/>
                </GridListTile>
              ))}
            </GridList>
          </Col>
          <Col style={embededVideoContainer} xs={12} md={8}>
            xs=6 md=4
          </Col>
        </Row>
      </Container>
    </div>
  </div>
  </>
}



const containerStyle: CSS.Properties = {
  display: 'flex',
  justifyContent: 'center',
};

const boxStyle: CSS.Properties = {
  justifyContent: 'start',
  marginTop: '50px',
  width: '80%',
  height: '800px',
  paddingTop: '60px',
  borderColor: 'black',
  borderWidth: '2px',
  borderStyle: 'solid'
};
const containers: CSS.Properties = {
  // display: 'flex',
  // flexDirection: 'row',
  // flexFlow: 'row',
  height: '690px',
  backgroundColor: 'beige'

};
const videosContainer: CSS.Properties = {
  // backgroundColor: 'blue',

};
const embededVideoContainer: CSS.Properties = {
  backgroundColor: 'red'
};
const gridList:CSS.Properties ={
  flexWrap: 'nowrap',
  // Promote the list into his own layer on Chrome. This cost memory but helps keeping high FPS.
  transform: 'translateZ(0)',
}
const root: CSS.Properties={
  display: 'flex',
  flexWrap: 'wrap',
  justifyContent: 'space-around',
  overflow: 'hidden',
}
